<p>Data example:</p>
<pre><code>{
'pid': 123456789,
'price': 55
},
{
'pid': 123456789,
'price': 25
},
{
'pid': 123456700,
'price': 10
}
</code></pre>
<p>I'm grouping by id and price like so</p>
<pre><code>qf = [
   {'$group': {
    '_id': '$pid',
    'prices': {'$addToSet': '$price'}
   }}
]
table.aggregate(qf)
</code></pre>
<p><strong>Current result</strong>:</p>
<pre><code>{
'123456789': [55, 25],
'123456700': [10]
}
</code></pre>
<p><strong>What I'm trying to get</strong>:</p>
<pre><code>{
'123456789': [55, 25]  # only data with 2 elements in a list!
}
</code></pre>
<p>Appreciate any help!</p>

