Response from mongodb either returns null or can't find specific document<p>I am building a login system, and i have ran into some issues, that i cannot figure out how to solve. I have tried some different options with find() and findOne() but either does not work in my case. Under here is the first solution i have tried to solve the issue.</p>
<pre><code>router.post('/', async (req, res) =&gt; {
    try {
        const user = await User.find(User.username = req.body.user);
        if (req.body.pass == user.password)
            res.send('Login');
        else
            res.send('Passwords don\'t match');
    } catch {
        res.send('User Not Found');
    }
});
</code></pre>
<p>This solution returns the catch response: User Not Found.</p>
<p>This is the second solution i have tried:</p>
<pre><code>router.post('/', async (req, res) =&gt; {
    try {
        const user = await User.find(User =&gt; User.username = req.body.user);
        if (req.body.pass == user.password)
            res.send('Login');
        else
            res.send('Passwords don\'t match');
    } catch {
        res.send('User Not Found');
    }
});
</code></pre>
<p>This solutions returns: Cannot set property 'username' of null.</p>
<p>I both cases i am sending this request:
<code>{&quot;user&quot;: &quot;Lasse&quot;, &quot;pass&quot;: &quot;LasseMJ&quot;}</code>
which is a user that i know exists in my database.</p>
<p>This is my Mongoose Schema:</p>
<pre><code>const mongoose = require('mongoose');

const userSchema = new mongoose.Schema({
    username: {type: String, required: true},
    password: {type: String, required: true}
});

module.exports = mongoose.model('Users', userSchema);
</code></pre>
<p>This is my server.js</p>
<pre><code>const express = require('express');
const bcrypt = require('bcrypt');
const mongoose = require('mongoose');
const userRoutes = require('./routes/users');
const loginRoutes = require('./routes/login');

if (process.env.NODE_ENV != 'production') {
    require('dotenv').config();
}

const app = express();
app.use(express.json());

app.use('/users', userRoutes);
app.use('/login', loginRoutes);


mongoose.connect(process.env.DB_CONNECTION, {
    useNewUrlParser: true,
    useUnifiedTopology: true 
 });
 const db = mongoose.connection;
 db.on('error', error =&gt; console.error(error));
 db.once('open', () =&gt; console.log('Connected to db'));

app.listen(3001);
</code></pre>

