In Mongoose I have User and Role schemas that have a one to many relationship. How to query if a particular User has the 'admin' role?<p>I have two collections in my Mongo DB: users and roles.  A user can have many roles.  Using Mongoose I want to find out whether a particular user (based on their id) has the admin role.  How do I perform that query? In SQL one way of finding out would be to write this query:</p>
<pre><code>SELECT *
FROM Users
INNER JOIN Roles ON Users.id = Roles.userID
WHERE (Users.id = &lt;some user id&gt; AND Roles.name='admin')
</code></pre>
<p>But I'm failing to see how the equivalent query is done using Mongoose.  Below are my Mongoose schemas:</p>
<pre><code>let RoleSchema = new Schema({
    name: String,
    owner: {
        type: Schema.Types.ObjectId,
        ref: &quot;User&quot;
    }
})
export let Role = mongoose.model(&quot;Role&quot;, RoleSchema)


let userSchema = new Schema({
    username: {
        type: String,
        unique: true,
        required: true,
        trim: true
    },
    roles: [
        {
            type: Schema.Types.ObjectId,
            ref: &quot;Role&quot;
        }
    ]
})
export let User = mongoose.model(&quot;User&quot;, userSchema)
</code></pre>

